import React from "react";

function NewList() {
  return (
    <div className="page-background">
      <h1>New List</h1>
      <form>
        <label htmlFor="name">Name</label>
        <input type="text" id="name" name="name" />
        <button type="submit">Create List</button>
      </form>
    </div>
  )
}

export default NewList;
